  return (
    <Router>
      <Routes>
        <Route path="/signup" element={<Signup />} />
        <Route path="/signup-upload-image" element={<SignupUploadImage />} />
        <Route path="/login" element={<Login />} /> {/* Ajoutez cette ligne */}
        {/* Autres routes */}
      </Routes>
    </Router>
  );
}

export default App;
